import './App.css';
import { albums } from './data';
import { Header } from "./components/header.js"

const image = albums[0]

function App() {
  return (
    <div className="App">
      <Header/>
      {
        albums.map((item, index) => {
        return (
          <div className='gamediv'>
            <img alt='' src={process.env.PUBLIC_URL + item.img} key={item.id}></img>
            <p>{process.env.PUBLIC_URL + item.text}</p>
          </div>        
        )})
      }      
    </div>
  );
}

export default App;
